		<text id="XMLID_81_" transform="matrix(1 0 0 1 493.0433 274.2973)"><tspan x="0" y="0" style="fill:#504736; font-family:'Nunito'; font-weight: bold; font-size:47.6759px;">A weasel leaves its lair underground. Today, it </tspan><tspan x="0" y="57.211" style="fill:#504736; font-family:'Nunito'; font-weight: bold; font-size:47.6759px;">has hopes of finding food for its young weasels, </tspan><tspan x="0" y="114.422" style="fill:#504736; font-family:'Nunito'; font-weight: bold; font-size:47.6759px;">that stay safe and sound inside their burrow.  </tspan><tspan x="0" y="171.633" style="fill:#504736; font-family:'Nunito'; font-weight: bold; font-size:47.6759px;"> </tspan><tspan x="0" y="228.844" style="fill:#504736; font-family:'Nunito'; font-weight: bold; font-size:47.6759px;">Because weasels are carnivorous, meaning they </tspan><tspan x="0" y="286.055" style="fill:#504736; font-family:'Nunito'; font-weight: bold; font-size:47.6759px;">eat meat, the mom has to hunt for food.</tspan></text>

<script type="text/javascript">
	function fadeIn(obj,secs) {
		setTimeout(function(){

            var el = document.getElementById(obj);
            var op = parseFloat(el.style.opacity);

            var timer = setInterval(function () {
                if(op >= 1.0)
                    clearInterval(timer);

                op += 0.1;
                el.style.opacity = op;
            }, 50);

		}, secs);
		
        }

document.addEventListener("DOMContentLoaded", function(event) { 
	fadeIn("Textbox", 100);
	fadeIn("Next", 2000);
});

</script>
